import {GitHub, LinkedIn} from '@material-ui/icons';
import styled from 'styled-components';

const Container = styled.div`
    position:absolute;
    width:100vw;
    height:100%;
    background-color:#f2f2b0;
`;

const Footer = styled.div`
    position:reltive;
    width:100%;
    display:flex;
    justify-content:center;
    align-items:center;
`;


const Icon = styled.div`
    position:relative;
    width:100px;
    height:100px;
    border-radius:50%;
    background-color:${props => props.color};
    margin:10px;
    display:flex;
    justify-content:center;
    align-items:center;
    font-size:15rem;
    color:white;
`;


function FirstPage() {
  return (
    <Container>
      <Footer>
        <Icon color="black">
          <GitHub/>
        </Icon>
        <Icon color='#2772db'>
          <LinkedIn/>
        </Icon>
      </Footer>


    </Container>
  )
}

export default FirstPage
